  [],\n\t\"revision_timestamp\": \"2015-12-08T21:04:20.121022\",\n\t\"name\": \"armenia-water-to-market-farmer-training-credit-component\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" n        The Farming Practices Survey
  (FPS) was commissioned by MCC to evaluate the impact of Water-to-Market (WtM) activities,
  particularly farmer training, on rural farmers in Armenia. Fielded by a consortium
  of AREG, an Armenia-based NGO, and Jen Consult, the FPS is a longitudinal survey
  of farming households interviewed at three points in time. FPS1 was conducted in
  2007, before farmer training began. A second round was conducted one year after
  training began. Data from the second round is not included in this package. FPS3,
  the final round, was conducted three years after training began.  This public-use
  file includes de-identified data from respondents to FPS3 and FPS1.nnHouseholds
  were selected for FPS1 interviews based on their likelihood of participating in
  WtM training, as assessed by mayors using criteria provided by the survey team.
  This process was used so that the surveyed households would include a high proportion
  of WtM participants. Each round of the FPS asked each household about their cropping
  patterns, irrigation and agricultural practices, crop yields, agricultural revenues
  and costs, other household expenditures, household employment, and other sources
  of household income.n      \",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
